function Admin() {
  return (

      <div className="App">
        <NavDashbord/>

        <BrowserRouter>  

      <Route   path="/ftage/dashboard">  <Sidebar/> </Route>



  </BrowserRouter>
      </div>

  );
}

export default Admin;
